import React from 'react';
import "../css/cadr.css";
import hostimg from "../images/Untitled.jpg"

const Host = () => {
    return ( 
        <div className="host">
            <div className="text-host">
                <h1>Event Host</h1>
                <p>Ања Макеска</p>
                <p>anja@brainster.co</p>
                <p>+389 (0)70 233 414</p>
            </div>
            <div className="host-img"></div>
        </div>
     );
}
 
export default Host;
